import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import './Product.css';

import api from '../services/api';

/*import logo from '../assets/logo.svg';
import dislike from '../assets/dislike.svg';
import like from '../assets/like.svg';
import itsamatch from '../assets/itsamatch.png';*/

export default function Main() {
  //const [products, setProdutcs] = useState([]);
/*<button type="button" onClick={() => handleDislike(user._id)}>
    <img src={dislike} alt="Dislike" />*/


  var products = [
    {
      title: "Skol 269ml",
      images: {
        url: "skol.jpg"
      },
      productVariants:[
        {
          old_price: 2.09,
          price: 1.99,
        }
      ]
    },
    {
      title: "Skol 269ml",
      images: {
        url: "skol.jpg"
      },
      productVariants:[
        {
          old_price: 2.09,
          price: 1.99,
        }
      ]
    },
    {
      title: "Skol 269ml",
      images: {
        url: "skol.jpg"
      },
      productVariants:[
        {
          old_price: 2.09,
          price: 1.99,
        }
      ]
    },
    {
      title: "Skol 269ml",
      images: {
        url: "skol.jpg"
      },
      productVariants:[
        {
          old_price: 2.09,
          price: 1.99,
        }
      ]
    },
    {
      title: "Skol 269ml",
      images: {
        url: "skol.jpg"
      },
      productVariants:[
        {
          old_price: 2.09,
          price: 1.99,
        }
      ]
    },                
  ];    
    /*
            <ul>  
          {users.map(user => (
            <li key={user._id}>
              <img src={user.avatar} alt={user.name} />
              <footer>
                <strong>{user.name}</strong> <span>{user.user}</span>
                <p>{user.bio}</p>
              </footer>

              <div className="buttons">
                <button type="button">
                </button>
                <button type="button" >
                </button>
              </div>
            </li>
          ))}
        </ul>
    */  
  return (    
    <div className="main-container">
      <div className="cards">
        {products.map(product => (        
        <div className="card">
          <div className="img">
            <img src={product.images.url} />
          </div>
          <footer className="card-footer">
            <div className="card-footer-info">
              <strong>{product.title}</strong>
              <div className="price">
                <span><del>R$ {product.productVariants.old_price}</del></span>
                <strong>R$ {product.productVariants.price}</strong>
              </div>  
            </div>
            <div className="card-footer-qtd">
              <div className="card-footer-total">
                <div className="desc">
                  Total
                </div>
                <div  className="value">
                  R$ 10,99
                </div>
              </div>
              <div className="qtd">
               <a className="btn btn-qtd-change">-</a>
               <input type="number" className="qtd-input" />
               <a className="btn btn-qtd-change">+</a>
              </div>                 
              <a className="btn btn-add">Adicionar ao carrinho</a>              
            </div>
          </footer>
        </div>
        ))}                            
      </div>
    </div>
  )
}
